import React from 'react';
import { useLocation } from 'react-router-dom'
import './Feature.css'

function Feature() {
  const location = useLocation()
  const header = (location) => {
    switch (location.pathname.split('/')[3]) {
      case 'new-arrivals':
        return 'Collections / New Arrivals'
      case 'home-bath':
        return 'Collections / Home + Bath'
      case 'kitchen-dinning':
        return 'Collections / Kitchen + Dinning'
      case 'office-craft':
        return 'Collections / Office + Craft'
      case 'personal-goods':
        return 'Collections / Personal Goods'
      default:
        return 'Collections'
    }
  }

  return (
    <div className='feature'>
      <div className='location'>
        <span>Home /&nbsp; {header(location)} /&nbsp; </span>
        <span>Page 1 of 1</span>
      </div>
      <div className='sort'>
        <label>Sort by:</label>
        <div className='sort-select'>
          <select name="feature">
            <option value="" onChange={(e) => {}}>Price: Low to High</option>
            <option value="">Price: High to Low</option>
          </select>
        </div>
      </div>
    </div>
  );
}

export default Feature;
